        //storage more efficient with out assignment, gas fee 2k
    }
    function loopArr() external view returns(uint){
        uint[] memory num=new  uint[](numClt.length);
        uint pzx=0;
        for(uint8 i=0; i<numClt.length; i++){
            if(numClt[i]%2==0){
                num[pzx] = (numClt[i]);
                pzx++;
            }
        }
        return num[1];
    }
}

